    <style>
        /* Body styling */
        body {
            font-family: 'Arial', sans-serif;
            margin: 0;
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            background: linear-gradient(135deg, #f8f9fa, #e9ecef);
            color: #333;
        }

        /* Main container styling */
        .container {
            text-align: center;
            padding: 40px;
            background-color: rgba(255, 255, 255, 0.8);
            border-radius: 10px;
            box-shadow: 0 15px 30px rgba(0, 0, 0, 0.1);
        }

        /* Link container styling */
        .link-container {
            margin: 20px 0;
        }

        /* Link styles */
        .link-container a {
            text-decoration: none;
            color: #fff;
            padding: 15px 30px;
            background: linear-gradient(135deg, #141516, #6a1b9a);
            border-radius: 50px;
            font-size: 18px;
            font-weight: bold;
            display: inline-block;
            position: relative;
            transition: transform 0.3s ease, box-shadow 0.3s ease;
            box-shadow: 0 8px 15px rgba(0, 0, 0, 0.1);
        }

        /* Hover effect for links */
        .link-container a:hover {
            transform: translateY(-5px);
            box-shadow: 0 15px 20px rgba(0, 123, 255, 0.4);
        }

        /* Hover effect text underline */
        .link-container a::after {
            content: '';
            position: absolute;
            bottom: -5px;
            left: 0;
            width: 0;
            height: 2px;
            background: #6a1b9a;
            transition: width 0.3s ease;
        }

        .link-container a:hover::after {
            width: 100%;
        }

        /* Mobile responsiveness */
        @media (max-width: 768px) {
            .container {
                padding: 20px;
            }

            .link-container a {
                padding: 12px 25px;
                font-size: 16px;
            }
        }
    </style>
